    return (
        <div>
            <div className="container">
                <div className="container user-input">
                    <input className="input" type="username" name="username" placeholder='Username'></input>
                    <FontAwesomeIcon icon={faHome} />
                </div>
                <input className="input input-pass" type="password" name="password" placeholder='Password'></input>
            </div>
            <button className="button">Sign In</button>
        </div>

    );
  }

